b9e155ecbd143fab:
{{Related|Phabricator dates}}
String used to localize dates in a basic format. Basic Latin letters are coded placeholders for date elements, that will be replaced by the localized value (do not translate these codes):
* <code>D</code>: localized name of a weekday (abbreviated);
* <code>l</code>: localized name of a weekday (not abbreviated);
* <code>j</code>: number of the day in the month (not padded with leading zeroes);
* <code>F</code>: localized name of the month (not abbreviated)
* <code>M</code>: localized name of the month;
* <code>Y</code>: Gregorian year (padded with leading zeroes if there's less than 4 digits);
* <code>a</code>: localized am or pm, lowercase
* <code>A</code>: localized AM or PM, uppercase
* if you need to include literal letters in the format string, place them between <code>"</code>ASCII double quotes<code>"</code>;
* other spaces or punctuation are used literally in the formatted date and don't need to be enclosed in <code>"</code>ASCII double quotes<code>"</code>.
* A more complete specification can be found on https://www.php.net/manual/en/datetime.format.php. None of these additional format options will be localized.

The messages used to localize the format options given are listed as related messages. To "translate" this string, use the appropriate placeholders to match your language's typical way of formatting dates, they are not meant to be displayed "as is".

This date format is displayed for dates less than 30 days ago. The alternate message {{msg-phab|arcanist-core-e0ac3c4e0da81dab}} is displayed for less recent dates.

Used in:

[https://phabricator.wikimedia.org/source/arcanist/browse/wmf%252Fstable/src//utils/viewutils.php$7 viewutils.php:7]

